import React from 'react';
import './TrackList.css';
import Track from '../Track/Track';

class TrackList extends React.Component {
    render() {
        let trackList = [{name: 'name7', artist: 'artist7', id: 7, album: 'album7' }, {name: 'name2', artist: 'artist2', id: 2, album: 'album2' }, {name: 'name3', artist: 'artist3', id: 3, album: 'album3'}];
        trackList = this.props.trackList;
        return (
            <div className="trackList">
                {
                    this.props.tracks.map( track => {
          return <Track onRemove={this.props.onRemove} isRemoval={this.props.isRemoval} track={track} key={track.id} addOn={this.props.addOn}/> })
      }
            </div>
        )    
    }
}

export default TrackList;
